import './HelpPage.css'; 

const HelpPage = () => {
  return (
    <div className="container">
      <div>
        <h2>Container 1</h2>
        <p>
          This is the content of container 1. You can add any information or
          components here that you want to display.
        </p>
      </div>
      <div>
        <h2>Container 2</h2>
        <p>
          This is the content of container 2. You can add any information or
          components here that you want to display.
        </p>
      </div>
    </div>
  );
};

export default HelpPage;
